import React from 'react';
import Card from 'react-bootstrap/Card';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import FaqData from '../infocomponents/FaqData.json';

function FaqBodyComponent() {
	const faqData = FaqData.map((faq) => {
		return (
			<Card key={faq.id}>
				<Card.Header>{faq.ques}</Card.Header>
				<Card.Body>{faq.ans}</Card.Body>
			</Card>
		);
	});
	return (
		<div>
			<Container>
				<Row>
					<Col>
						<Card bg="transparent">
							<Card.Title>
								<h3 className="slogan-1 ml-3 mt-3">FAQ</h3>
								<hr className="new4 mr-5 ml-5" />
							</Card.Title>
						</Card>
					</Col>
				</Row>
			</Container>
		</div>
	);
}

export default FaqBodyComponent;
